import React from "react";
import "./Home.scss";

const Home = () => {
  return (
    <div className="Home">
      <div className="layout-container">
        <div className="title">
          <h1>HI. I'm developer</h1>
          <p>Many challenges, many opportunities</p>
        </div>
        <div className="banner">
          <div className="sub-text">F*cking Code !</div>
          <img src="https://i.pinimg.com/564x/82/4d/9e/824d9e397b890e18dd9b92fb1cf9ee1d.jpg" alt="..."></img>
        </div>
      </div>
    </div>
  );
};

export default Home;
